import React from "react";
import Card from './Card';


const CardList = ({ robots }) => {
   return (
    <div>
        {
            robots.map((user, i) => {
                return(
                    <div>
                    <h1>RobotFriends</h1>
                    <Card 
                        key={robots[i].id}
                        id={robots[i].id}
                        name={robots[i].name}
                        email={robots[i].email}
                    />
                    </div>
                );
            })
        }   
    </div>
     );
    }
    

export default CardList;
